(1, '2021-07-14 16:14:40', '5 Ways Cow Milk Helps You Stay Strong', 'bc62b681-6957-4087-82bb-c0434140d98b', 'he many benefits of the glass of milk mom forced you to have!', '<p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Milk is a staple beverage in Indian homes and an essential part of our daily nutrition. As an Indian, it is impossible to imagine a diet not consisting of milk, a portion of food that we attribute most of our child’s growth and development to.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Along with being great for health it also forms an essential part of all dessert preparations. Adding milk to any dish be it sweet or savory makes it 5 times better than what it was.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">You may remember your mother forcing you to gulp down a glass of milk daily as a child and stating that it will help you get the strength to fight off disease and give you the energy to play longer. With the changing times the way we consume milk has changed too- what was once a simple glass of plain milk is now had as smoothies, flavoured milk, and a lot more.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">The Complete meal</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Loaded with essential minerals and vitamins, cow milk is a whole meal just by itself. A glass of cow milk provides nutrition equivalent to:</p><ul _ngcontent-jhj-c63=\"\" class=\"mb-2\" style=\"margin-right: 0px; margin-left: 0px; padding: 0px; list-style: outside none none; overflow-wrap: break-word; outline: 0px; color: rgb(50, 50, 50); font-size: 14px; background-color: rgba(236, 236, 236, 0.74);\"><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Vitamin A: In two hard-boiled eggs</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Phosphorous: In a cup full of kidney beans</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Calcium: As much as 10 cups of raw spinach</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Riboflavin: Equivalent to 1/3rd cup of whole almonds</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Protein: As much as chicken thigh</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Potassium: Equal to a small banana</li><li _ngcontent-jhj-c63=\"\" style=\"margin: 0px 0px 0px 40px; padding: 0px; list-style: disc; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify;\">Vitamin D: As much as present in 21 grams of salmon</li></ul><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">It works wonders for boosting immunity and helps repair damage to cells and tissues in different parts of your body.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Milk, especially milk from native Indian Gir Cows, is easy to digest and is often referred to as ‘Amrut’ due to its many health benefits. Let us take a look at the 5 ways Cow Milk helps our body:</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">1. Strengthens bones and muscles:</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">The most commonly heard benefit of milk. Cow milk has a considerable amount of calcium, a mineral directly responsible for bone health. It helps boost core strength and keeps degenerative conditions such as osteoporosis and osteoarthritis at bay. Cow milk also contains a significant amount of phosphorus, vitamin D, calcium, and magnesium necessary for the overall growth and development of your body.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">2. Good for weight loss:</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Due to its high nutritional value and low-fat content, cow milk helps with weight loss as well. It is quite filling and satiates midnight hunger cravings allowing you to skip junk foods for a healthier alternative.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">3. Benefits for Diabetes and Heart Health</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">A glass of cow’s milk on a daily basis helps maintain adequate blood sugar levels. It contains all the necessary minerals and vitamins to process the food you eat regularly, which helps in maintaining glucose and insulin levels.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">It is also filled with a high amount of omega-3 fats which are necessary for your body. It assists in improving cholesterol levels as well. This gives a positive impact on overall heart health.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">4. Brain food:</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Being a goldmine of vitamin B, cow milk is an important brain food. It helps calm nerves and maintains a proper sleep schedule. The Vitamin B12 content in it helps improve grasping power and memory and is extremely beneficial for growing kids.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 20px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74); font-weight: 600;\">5. Growth and Development:</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">Loaded with protein that is essential to perform internal bodily functions, cow milk plays a pivotal role in growth and development. Scientific research has concluded that cow’s milk aids growth and development, both physically and psychologically.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">With its multitude of benefits to health and overall wellbeing, cow milk is the ideal beverage one can consume. However, a lot of the milk available in the market is adulterated and loaded with preservatives, which take away the natural goodness found in it. It is crucial that you choose the right milk for your family’s well-being.</p><p _ngcontent-jhj-c63=\"\" style=\"margin-bottom: 12px; padding: 0px; list-style: none; overflow-wrap: break-word; outline: 0px; font-family: Rubik; font-size: 18px; text-align: justify; color: rgb(50, 50, 50); background-color: rgba(236, 236, 236, 0.74);\">You can try Desi Farms Cow Milk variants such as the Gold Milk (free of preservatives), Whole Milk (free of antibiotics, one-of-its-kind), and Gir Cow Milk (premium offering, free of preservatives, hormones, loaded with nutrients). All the products are free of added preservatives and chemicals and are delivered to your doorstep within 12-24hrs of milking.</p>', 4, 3, 1, 2),
(2, '2021-07-15 11:21:04', 'WHAT KIND OF MILK SHOULD YOU GIVE YOUR KIDS?', 'fe408020-f5a2-44db-b0ef-0cc23b0b8bc4', 'From a very early age,', '<section class=\"post_featured\" style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; overflow: hidden; margin-bottom: 1.95em; position: relative; color: rgb(114, 114, 114);\"><div class=\"post_thumb\" data-image=\"https://desifarmsindia.com/wp-content/uploads/2018/01/WHAT-MILK-TO-GIVE-YOUR-KID.jpg\" data-title=\"&nbsp;What kind of&nbsp;milk should you give your kids?\" style=\"font-family: inherit; font-style: inherit; font-weight: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"font-family: inherit; font-style: inherit; font-weight: inherit; background-color: transparent;\"><br></span></div><div class=\"post_thumb\" data-image=\"https://desifarmsindia.com/wp-content/uploads/2018/01/WHAT-MILK-TO-GIVE-YOUR-KID.jpg\" data-title=\"&nbsp;What kind of&nbsp;milk should you give your kids?\" style=\"font-family: inherit; font-style: inherit; font-weight: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"font-family: inherit; font-style: inherit; font-weight: inherit; background-color: transparent;\">From a very early age, children are encouraged&nbsp;by their parents&nbsp;to drink milk, whether they like it or not.&nbsp;Milk is an important source of&nbsp;calcium, protein, vitamins and minerals for babies.&nbsp;It is&nbsp;vital for brain development and bone structure.&nbsp;Moreover, it is an important energy booster for kids and improves their immunity.</span><br></div></section><section class=\"post_content\" itemprop=\"articleBody\" style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(114, 114, 114);\"><p style=\"font-family: inherit; font-style: inherit; font-weight: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em;\">But what type of milk should kids be drinking once they’ve stopped being breast fed?&nbsp;Transition from breast milk to cow milk can be difficult&nbsp;which is why the caliber of the milk is vital.&nbsp;Besides other nutrients, many children don’t&nbsp;even&nbsp;get enough fat and calories in their diet and&nbsp;therefore&nbsp;usually need the extra fat from&nbsp;<span data-dobid=\"hdw\" style=\"font-family: inherit; font-style: inherit; font-weight: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\">dairy</span>. A2 Gir Cow Milk can thus prove to&nbsp;be a good option for healthy growth. We at Desi Farms provide this milk, which is not only unadulterated but also antibiotics free.</p><p style=\"font-family: inherit; font-style: inherit; font-weight: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em;\">Moreover, if children refuse to drink&nbsp;at least&nbsp;one to two glasses of milk a day, parents can turn to other bi-products of milk&nbsp;like&nbsp;flavored milk,&nbsp;yogurt and bread, all of which is available at Desi Farms. So,&nbsp;while considering what brand of milk to select for your child at your nearby hypermarket, look for Desi Farms for good taste and great quality.</p></section>', 4, 2, 1, 2),
(3, '2021-07-15 11:21:39', 'LET THIS SHORT QUIZ VERIFY THE PURITY OF YOUR MILK', '90f11d55-ee05-4a7d-9bfd-994abed5f3e1', 'The Purity of milk that we consume everyday has been a point of worry for quite some time now.', '<p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">The Purity of milk that we consume everyday has been a point of worry for quite some time now. Somewhere, we keep hearing about so much adulteration in milk and milk products that it is but natural to feel a bit insecure about the quality of milk that you and your family are consuming. Whether it is your age old “doodhwala” (milkman) supplying your daily dose of milk from door to door or the bigger better brand pasteurized milk suppliers sending out poly packs and cartons of your daily essential, with so much adulteration in food items, you can never be sure of what you are consuming in the name of pure milk.<br>Like most adulterated things, impure milk also has a lot of negative effects on your health. Adulterated milk (depending upon the type of adulterant) can lead to serious health issues in adults as well as young children. Going by our traditional mindset of “milk is a must have for children”, it is all the more important to be sure that the milk that our children are having, is pure, unadulterated and giving them the health benefits that it is supposed to give them.<br><strong style=\"font-family: inherit; font-style: inherit; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\">So, here’s a quick Quiz that you can take to know whether the milk that you consume is pure or not:</strong><br>1. Take a drop of milk on a smooth slanting surface. Does the drop of milk run down fast leaving nor traces behind instead of going down slowly and leaving a white trace behind?<br>Yes<br>No<br>2. Add 2 tablespoons of salt to about 2 teaspoon of milk. Does the mixture turn blue?</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">Yes</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">No</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">3. Does your Milk feel soapy to touch and tastes foul?</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">Yes</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">No</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">4. Mix some Arhar dal powder in about half tablespoon of milk. Dip a red litmus paper in it. Does this paper turn blue?<br>Yes<br>No</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">5. When you boil milk for long time and solidify it to make Khoya, the final solidified product looks hard and dry instead of soft and oily?</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">Yes</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">No</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">6. Take a lactometer from a nearby science shop. Does the red mark sink in a glass of milk instead of staying afloat?</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">Yes</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">No</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">Result:<br>If you have answered Yes to more than 1 question, then your milk is definitely adulterated. The more the number of yes in your answers, the farther you are away from pure milk.<br>So go ahead, do these simple tests at home and answer the questions provided above. You will find some strong answers to pressing doubts on your mind. Give yourself and your family a healthy life by identifying pure from adulterated and making right choices.</p><p style=\"font-family: Average, serif; font-size: 15px; line-height: inherit; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin-bottom: 1.4em; color: rgb(114, 114, 114);\">TWEETS:<br>1. Don’t be in doubt. Test your milk’s purity at home. #HomeTestsForPureMilk #DesiFarmsQuiz<br>2. Is Your Milk Really Pure? Take Our Quiz from the latest article in Blog Section #PureMilk<br>3. Simple Questions to verify purity of your milk. #DesiFarmsQuiz<br>4. Take our quiz and settle your doubts about milk purity. Check our blogs section #DesiFarmsIndia<br>5. Find answers to questions that have been troubling you for long. Ensure good health with pure milk tests. Take the quiz #DesiFarmsQuiz</p>', 4, 1, 1, 2),
(4, '2021-10-25 11:52:17', 'Exploring the growth of plant-based milk alternatives', 'c8c0e6cd-01eb-4ced-8ac8-71ddb99657e2', 'The plant-based milk alternatives market now accounts for around 10% of the global \'milk\' market.', '<p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">Plant-based milk alternatives are the largest plant-based food category in North America and grew 5% last year. In fact, the plant-based milk alternatives market now accounts for around 10% of the global “milk” market, and the growing number of consumers of plant-based milk alternatives have more choices than ever before.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">The most popular plant-based milk alternative type in North America is currently almond (which occupies almost two-thirds of the market), followed by oat (the fastest-growing product type) and soy. However, the sector is full of innovation.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">The range of plant-based milk alternatives also allows for consumers to express their tastes and identities as cafes and restaurants open up after lockdown. As one industry analyst said earlier this year, “To choose your specific type of plant-based milk in Starbucks seems to be a way of identifying yourself.”</p>', 1, 4, 1, 2),
(6, '2021-10-25 12:04:22', 'Dairy processors could benefit from cloud-based label management', '411d41a2-720a-46bb-b3ce-e1aa9cba177c', 'A modern, standardized approach to label management is now more critical than ever, with a considerable impact on overall sustainability.', '<p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">Each year, nearly 1.5 billion tons of perishable food is wasted due to inefficiencies found within the food supply chain, and 55 million tons of milk is thrown out before it even reaches the consumer. While there are many factors that contribute to food and dairy waste — and the ensuing pollution it causes — many have yet to consider the impact of one seemingly small aspect: label management. Yet the impact of this piece of the puzzle is considerable.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">The truth is, poorly performing label management methods, legacy IT equipment and older software place a significant burden on supply chains across many levels. And to keep up with ongoing demands, support agility and ultimately become more sustainable, many food manufacturers could benefit from taking a more modern, digital and standardized approach to label management.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">&nbsp;</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\"><strong>Streamline quality control: a key to success</strong></p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">Many still rely on manual practices that result in unsafe and inefficient labeling. For example, a method known as “six eyes” requires at least three individuals to physically inspect labels for approval.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">Although this process provides some level of quality control, it’s time-consuming, highly prone to human errors and very labor-intensive. It also opens the door for troublesome scenarios such as an error only being noticed once on the line. This can drastically slow down operations and even cause workers to painstakingly apply new labels by hand, scan them into the system and then unpack them.</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">With a standard, enterprise-wide label management approach, human error can be reduced, and many issues can be prevented before problems arise. For example, standardized templates containing the right data can be stored centrally, and access can be granted based on a user’s function, which enables more oversight of who can use, edit and create label templates. &nbsp;</p><p style=\"margin-bottom: 0.625rem; color: rgb(51, 51, 51); font-family: Lora, serif; font-size: 16px;\">With a simple-to-use and deploy solution, standard label templates can also be easily extended to suppliers and other third parties. This further guarantees the right labels are used and reduces errors leading to recalls or relabeling. Additionally, if labeling is standardized, unplanned downtime and other delays can be decreased because there are fewer disparately operating points of failure.&nbsp;&nbsp;</p>', 1, 5, 0, 2);
