(1, 1, 1, '2021-05-18 12:11:11', 'Pain Shrikhand', '<h2><font face=\"Calibri\">Desi Farms Shrikhand is whole milk shrikhand , Freshly made with added pistachio , almonds ,cardamom and nutmeg</font></h2>', 5, 5, 10, 2563, 'bb997e8f-f64d-42e9-b989-29b5b79d4a20', 8, 1, 'Packing', 0, 'Shrikhand', 1, 1, 3),
(2, 1, 1, '2021-05-18 12:22:48', 'Mango Shrikhand', 'Desi Farms Shrikhand is whole milk shrikhand , Freshly made with added pistachio , almonds ,cardamom and nutmeg', 2.5, 2.5, 5, 5632, 'c946ba8d-c9c9-49d6-8766-bd12701013ca', 9, 1, 'Packing', 0, 'null', 1, 1, 3),
(3, 6, 1, '2021-05-24 22:16:39', 'A2 Gir Cow Milk', '<p class=\"normal\"><span>For&#10;your family&#8217;s well-being enjoy the purest form of milk from the Indian breed,&#10;Gir cows - A2 Gir Cow Milk. It is free of antibiotics, chemical preservatives,&#10;and hormones. </span></p>&#10;&#10;<p class=\"normal\"><span>This&#10;milk is wholesome and processed and packaged maintaining the highest standards&#10;of purity and hygiene. At our state-of-the-art milk processing plant the milk&#10;goes through 20+ stringent quality checks. </span></p>&#10;&#10;<p class=\"normal\"><span>The&#10;preservative-free milk is pasteurised and packaged using the best of processes.&#10;The milk is delivered fresh at your doorstep within 12-24 hours of milking.</span></p>&#10;&#10;<span>Being rich in calcium, kids should have 1-2 glasses&#10;of milk daily for strong bones. It also helps strengthen the teeth.</span>', 5, 5, 10, 2563, 'e5ab2cd5-7ceb-4942-80a3-1fc602c8084f', 1.1, 1, 'Packing', 0, 'Gir Cow Milk A2', 1, 1, 2),
(4, 6, 1, '2021-05-24 22:18:29', 'Cow Milk Gold', '<p class=\"normal\"><span>Have&#10;a glass or two of our Cow Milk Gold daily to lead a healthy life. It&#8217;s pure and&#10;chemical preservative-free. </span></p>&#10;&#10;<p class=\"normal\"><span>We&#10;source fresh milk every day from our local partner farmers. At our ISO&#10;certified modern processing plant every batch of milk is run through 20+&#10;quality and adulteration tests. The milk is further pasteurised to prevent any&#10;kind of bacterial growth. </span></p>&#10;&#10;<p class=\"normal\"><span>The&#10;preservative-free milk is packaged in the most hygienic manner. It reaches your&#10;doorstep through the finest cold chain system. The milk is delivered fresh&#10;within 12-24 hours of milking.</span></p>&#10;&#10;<span>The milk is rich in Calcium and Protein, among&#10;other essential nutrients such as Phosphorus, Vitamin B2, Vitamin B12,&#10;Magnesium, and more.&#160;&#160;</span>', 5, 5, 10, 2563, '5cee7b07-348f-472e-b614-63b27a54db47', 2, 1, 'Packing', 0, 'Cow Milk Gold', 1, 1, 2),
