(21, 13, 1, '2021-07-02 14:16:36', 'Mango Barfi', '<span>Burfi/ Peda&#8217;s</span><span>&#160;are khoya/khoa (milk solids) based Indian fudge. Besides the plain ones, they come in varieties of flavors. It&#8217;s the season of the king of fruits in India, yes none other than the sweet and addictive mangoes, so fitting for that title! So today&#8217;s burfi is flavored with mango, and we have</span><span>&#160;Mango burfi&#160;</span><span>or</span><span>&#160;Mango&#160;barfi</span><span>!</span>', 9, 9, 18, 123457, 'ab5ed405-db47-4de2-a352-b17c738b7683', 9, 0, 'Packing', 0, 'barfi', 1, 1, 2),
(22, 14, 1, '2021-07-17 11:49:51', 'Mango', '<span>Mango is a good source of folate, several B vitamins, as well as vitamins A, C, K and E &#8212; all of which help boost immunity.It is rich in vitamins, mineral and antioxidants and has been associated with many health benefits, including potential anticancer effects as well as improved immunity, digestive, eye, skin and hair health. As compared to other varieties of&#160;mangoes, it is naturally very sugary and soft. The size of the seed is small and oval in shape. Langra maintains it green color after it gets ripe, while other&#160;mangoes&#160;change into yellow-reddish color.</span>', 6, 6, 12, 0, 'e630f999-8010-4e3d-be41-6c266e5d252c', 3.18, 0, 'Packing', 0, 'null', 1, 1, 12),
