    Remark,
    Narration,
    Batch_No,
    Mfg_Date,
    Entry_Type,
    Staff_Id,
    Unit_Price,
    Voucher_Category
)
SELECT
sodm.Sale_Order_Id,
CURRENT_TIMESTAMP,
(
	SELECT som.Franchise_Id
