    NEW.Sale_Order_Id
)Franchise_Customer_Id,
sodm.Product_Id,                
sodm.Product_Name,
sodm.Product_Packaging_Rate_Id,
-sodm.Order_Qty,
sodm.Package_Qty,
sodm.Unit_Id,
sodm.Unit_Name,
"OnlineSale" AS Type,
(
    SELECT CONCAT(som.Cust_Name, ' ', som.Sub_Area_Name, ' ', som.Area_Name)
	FROM tb_sale_order_master som
	WHERE som.Sale_Order_Id      			=
    NEW.Sale_Order_Id
) AS Remark,
"" AS Narration,
"" AS Batch_No,
CURRENT_TIMESTAMP AS Mfg_Date,
"Final" AS Entry_Type,
(
	SELECT som.Franchise_Id
	FROM tb_sale_order_master som
	WHERE som.Sale_Order_Id      			=
    NEW.Sale_Order_Id
)Franchise_Customer_Id,
sodm.Selling_Amt,
"Billed To Customer" AS Voucher_Category
FROM tb_sale_order_detail_master sodm
INNER JOIN tb_sale_order_master som
ON som.Sale_Order_Id = sodm.Sale_Order_Id
WHERE sodm.Product_Status = 'Delivered'
AND sodm.Sale_Order_Id = NEW.Sale_Order_Id
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_sale_order_detail_status` AFTER UPDATE ON `tb_sale_order_master` FOR EACH ROW UPDATE tb_sale_order_detail_master sodm
SET sodm.Product_Status = (
    SELECT som.Order_status FROM 			
    tb_sale_order_master som  WHERE 
    som.Sale_Order_Id = NEW.Sale_Order_Id)
WHERE sodm.Sale_Order_Id = NEW.Sale_Order_Id
AND sodm.Product_Status != "Cancel"
$$
DELIMITER ;

