DELIMITER $$
CREATE TRIGGER `insert_sale_order_wallet` AFTER INSERT ON `tb_temp_subscription_order` FOR EACH ROW BEGIN
IF(NEW.Is_Process = 'True') THEN
SET @Cust_ID := NEW.Cust_Id;
SET @WalletCust_ID := NEW.Cust_Id;
SET @Franchise_Id := NEW.Franchise_Id;
SET @WalletFranchise_Id := NEW.Franchise_Id;
SET @Wallet_Amount_Used := NEW.Wallet_Amount_Used;
SET @CSWallet_Amount_Used := NEW.Wallet_Amount_Used;
NEW.Customer_Delivery_Address_State_Id,'1','1',
@Cust_ID,NEW.Cust_Name,NEW.Mobile_Number,NEW.Email_Id,
'Subscribe',NEW.Delivery_Address_Id,NEW.Full_Name,
NEW.Mobile_No_Address,NEW.Flat_House_No,NEW.Area_Colony_Sreet_Name,
NEW.Landmark,NEW.Pincode,NEW.City,NEW.Area_Id,NEW.Area_Name,
NEW.Sub_Area_Name,NEW.Sub_Area_Id,NEW.Address_Type,'0','0',
'0','0',NEW.Delivery_Slot_Id,NEW.Slot_Name,NEW.Customer_Delivery_Date,
NEW.Slot_Start_Time,'2',@Wallet_Amount_Used,'Complete',
NEW.Subscription_Order_Id);

SET @Sale_Order_Id := (LAST_INSERT_ID());
SET @MasterIDS := @Sale_Order_Id;

SET @Msg := CONCAT('Purchase Subscribe Product - Order ID -', @Sale_Order_Id);
UPDATE `tb_customer_subscription_order_master` SET
Next_Delivery_Date = DATE_ADD(NEW.Next_Delivery_Date, INTERVAL NEW.Interval_Days DAY),
Last_Process_Date_Time = CURRENT_TIMESTAMP
WHERE Subscription_Order_Id = NEW.Subscription_Order_Id;
END IF;
UPDATE `tb_customer_subscription_order_master` SET
Next_Delivery_Date = DATE_ADD(NEW.Next_Delivery_Date, INTERVAL NEW.Interval_Days DAY),
Last_Process_Date_Time = CURRENT_TIMESTAMP
WHERE Subscription_Order_Id = NEW.Subscription_Order_Id;
END
$$
DELIMITER ;

